//  };

  return (
    <>
      <div className="row">
        <div className="col-2"></div>
        <div className="col-8">
          <form onSubmit={handlevalues}>
            <div className="form-group mt-3">
              <label for="" className="form-label">
                ExamId
              </label>
              <input
                type="text"
                id="examid"
                className="form-control  w-50 "
                placeholder="ExamId eg(1)"
                name="examId"
                value={handlevalues.examId}
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Examname
              </label>
              <input
                type="text"
                id="examname"
                className="form-control  w-50"
                placeholder="Examname"
                name="examName"
                value={handlevalues.examname}
              />
            </div>
            <div className="form-group mt-3">
              <label for="" className="form-label ">
                Description
              </label>
              <input
                type="text"
                id="description"
                className="form-control   w-50"
                placeholder="Description "
                name="description"
                value={handlevalues.description}
              />
            </div>

            <div className="form-group mt-3">
              <label for="" className="form-label ">
